const Persons = ({person,removedPerson}) =>{

  return(
    person.name !== null ?
    <div>

        <div style={{paddingBottom:'1.5em'}}>{person.name} {person.number} <button onClick={removedPerson}>Delete</button></div>
    </div>
    :
    <div></div>
  )
}

export default Persons
